(function (e) {
  "use strict";
  var t = function (e, i) {
    var t = e.find(".felan-search-horizontal");
    var c = t.find("#search-horizontal_filter_search");
    var n = c.data("key");
    c.autocomplete({
      source: n,
      minLength: 0,
      autoFocus: false,
      focus: true,
    }).focus(function () {
      i(this).data("uiAutocomplete").search(i(this).val());
    });
    t.find(".felan-clear-top-filter").on("click", function () {
      c.val("");
      t.find(".felan-select2").val("");
      t.find(".felan-select2").select2("destroy");
      t.find(".felan-select2").select2();
      t.find(".input-search-location").val("");
      var e = t.find(".felan-select2");
      e.each(function () {
        var e = i(this).find("option");
        if (theme_vars.enable_search_box_dropdown == 1) {
          if (e.length > theme_vars.limit_search_box) {
            i(this).select2();
          } else {
            i(this).select2({ minimumResultsForSearch: -1 });
          }
        } else {
          i(this).select2({ minimumResultsForSearch: -1 });
        }
      });
      i(".select2.select2-container").on("click", function () {
        var e = i(this).prev().find("option");
        e.each(function () {
          var e = i(this).val();
          var t = i(this).attr("data-level");
          i('.select2-results li[id$="' + e + '"]').attr("data-level", t);
        });
      });
      i(".felan-form-location .icon-arrow i").on("click", function () {
        var e = i(this)
          .closest(".felan-form-location")
          .find("select.felan-select2 option");
        e.each(function () {
          var e = i(this).val();
          var t = i(this).attr("data-level");
          i('.select2-results li[id$="' + e + '"]').attr("data-level", t);
        });
      });
    });
  };
  e(window).on("elementor/frontend/init", function () {
    elementorFrontend.hooks.addAction(
      "frontend/element_ready/felan-search-horizontal.default",
      t
    );
  });
})(jQuery);
